import CollectionReference = FirebaseFirestore.CollectionReference
import FieldPath = FirebaseFirestore.FieldPath
import DocumentData = FirebaseFirestore.DocumentData
import WhereFilterOp = FirebaseFirestore.WhereFilterOp
import QuerySnapshot = FirebaseFirestore.QuerySnapshot
import OrderByDirection = FirebaseFirestore.OrderByDirection

export const doc = (collection: CollectionReference) => (documentPath?: string) => {
    if (documentPath)
        return collection.doc(documentPath)
    return collection.doc();
}
export const add = (collection: CollectionReference) => (data: DocumentData) => collection.add(data); // we force a string for documentPath
export const where = (collection: CollectionReference) => (fieldPath: string|FieldPath, opStr: WhereFilterOp, value: any) => collection.where(fieldPath, opStr, value);
export const select = (collection: CollectionReference) => (...field: (string | FieldPath)[]) => collection.select(...field);
export const offset = (collection: CollectionReference) => (offset: number) => collection.offset(offset);
export const limit = (collection: CollectionReference) => (limit: number) => collection.limit(limit);
export const startAt = (collection: CollectionReference) => (...fieldValues: any[]) => collection.startAt(...fieldValues);
export const startAfter = (collection: CollectionReference) => (...fieldValues: any[]) => collection.startAfter(...fieldValues);
export const endAt = (collection: CollectionReference) => (...fieldValues: any[]) => collection.endAt(...fieldValues);
export const endBefore = (collection: CollectionReference) => (...fieldValues: any[]) => collection.endBefore(...fieldValues);
export const onSnapshot = (collection: CollectionReference) => (onNext: (snapshot: QuerySnapshot) => void, onError?: (error: Error) => void) => collection.onSnapshot(onNext, onError);
export const isEqual = (collection: CollectionReference) => (other: CollectionReference) => collection.isEqual(other);
export const orderBy = (collection: CollectionReference) => (fieldPath: string|FieldPath, directionStr?: OrderByDirection) => collection.orderBy(fieldPath, directionStr);
export const stream = (collection: CollectionReference) => () => collection.stream();
export const get = (collection: CollectionReference) => () => collection.get();
export const listDocuments = (collection: CollectionReference) => () => collection.listDocuments();
export const id = (collection: CollectionReference) => collection.id
export const parent = (collection: CollectionReference) => collection.parent
export const path = (collection: CollectionReference) => collection.path
export const firestore = (collection: CollectionReference) => collection.firestore
export default doc;
